import React, {Component} from 'react';

class Team extends Component {
    render() {
        return (

                <div className={"card "+this.props.bophan}>
                    <div className="box-img">
                        <img src={this.props.anhteam} alt="anh"/>
                    </div>
                    <div className="card-nd">
                        <div className="lh">
                            <ul>
                                <li><i className="fab fa-facebook" /></li>
                                <li><i className="fab fa-linkedin" /></li>
                                <li><i className="fab fa-twitter-square" /></li>
                            </ul>
                        </div>
                        <h2 className="teamname">{this.props.ten}</h2>
                        <p className="vaitro">{this.props.vitri}</p>
                        <p className="motavt"> {this.props.mota}</p>
                    </div>
                </div>


        );
    }
}

export default Team;
